import React, { useContext, useRef, useEffect, useState } from "react";
import TestContext from "../../../Context/testContext";
import AuthContext from "../../../Context/Auth/authContext";

function useEffectSkipFirst(fn, arr) {
  const isFirst = useRef(true);
  useEffect(() => {
    if (isFirst.current) {
      isFirst.current = false;
      return;
    }
    fn();
  }, arr);
}

const ResultSolo = () => {
  const testContext = useContext(TestContext);
  const authContext = useContext(AuthContext);
  const { GetRankAndPointOfTournament, rankAndPoinOfTournaments, err } =
    testContext;
    const [TournamentScore, setTournamentScore] = useState([]);


    useEffect(() => {
        GetRankAndPointOfTournament(58);
      }, []);

      useEffectSkipFirst(() => {
        if (eventInfoData) {
          let newData = eventInfoData.map((item) => {
            let newItem = {};
            newItem.ID = item.ID;
            newItem.Title = item.Title;
            newItem.Goal = item.Goal;
            newItem.ProjectName = item.ProjectName;
            newItem.PrsNum = item.PrsNum;
            newItem.Nam = item.Nam;
            newItem.NamKhanevadegi = item.NamKhanevadegi;
            newItem.MiladiDate = item.MiladiDate;
            newItem.status = item.status;

            return newItem;
          });
          setEventData(newData);
        }
      }, [eventInfoData]);


  return (
    <div className="RoulsSolo">
      <div className="title">
        <h4>Placement</h4>
        <h4>ID</h4>
        <h4></h4>
        <h4>Score</h4>
        <h4>View Details</h4>
      </div>
      <div className="Row">
        <h4>1</h4>
        <h4>snoopps</h4>
        <h4>Remove</h4>
        <h4>243.4</h4>
        <h4>View Details</h4>
      </div>
      <div className="Row">
        <h4>2</h4>
        <h4>snoopps</h4>
        <h4>Remove</h4>
        <h4>243.43</h4>
        <h4>View Details</h4>
      </div>
      <div className="Row">
        <h4>3</h4>
        <h4>snoopps</h4>
        <h4>Remove</h4>
        <h4>243.43</h4>
        <h4>View Details</h4>
      </div>
      <div className="Row">
        <h4>4</h4>
        <h4>snoopps</h4>
        <h4>Remove</h4>
        <h4>243.43</h4>
        <h4>View Details</h4>
      </div>
      <div className="Row">
        <h4>5</h4>
        <h4>snoopps</h4>
        <h4>Remove</h4>
        <h4>243.43</h4>
        <h4>View Details</h4>
      </div>
      <div className="Row">
        <h4>6</h4>
        <h4>snoopps</h4>
        <h4>Remove</h4>
        <h4>243.43</h4>
        <h4>View Details</h4>
      </div>
      <div className="pagination">
        <h6>←</h6>
        <h6>1</h6>
        <h6>2</h6>
        <h6>3</h6>
        <h6>4</h6>
        <h6>5</h6>
        <h6>→</h6>
      </div>
    </div>
  );
};

export default ResultSolo;
